using System;
using System.Runtime.InteropServices;
#pragma warning disable
namespace IntegerSetLibrary {

public class aff : IntrusiveHandle {

internal aff(/* __isl_take */ IntPtr handle)
  : base(handle) {}

 public /* explicit */ aff(ctx ctx, string str) : base(IntPtr.Zero) 
{
  var res = Interop.isl_aff_read_from_str(ctx.DangerousGetHandle(), str);
  if (res == IntPtr.Zero) {
    throw new InvalidOperationException();
  }
  SetHandle(res);
}

protected override bool ReleaseHandle() {
  Interop.isl_aff_free(handle);
  return true;
}

internal override IntPtr IncreaseReference() {
  if (handle == IntPtr.Zero) {
    throw new ArgumentNullException("NULL input");
  }
  return Interop.isl_aff_copy(handle);
}


 public aff add(aff aff2)
{
  if (IsInvalid || aff2.IsInvalid) {
